import createLucideIcon from '../createLucideIcon';

const Lock = createLucideIcon('Lock', [
  [
    'rect',
    {
      x: '3',
      y: '11',
      width: '18',
      height: '11',
      rx: '2',
      ry: '2',
      key: 'biyj2e',
    },
  ],
  ['path', { d: 'M7 11V7a5 5 0 0 1 10 0v4', key: 'fwvmzm' }],
]);

export default Lock;
